import axios from 'axios';
import React from 'react';
import { useState } from 'react';

function GetNonAdmins() {
    const url = 'http://localhost:5000/admin/getNonAdmins';

    const [data, setData] = useState([]);

    React.useEffect(() => {
        axios.get(url).then(json => setData(json.data));
    }, []);

    const setAdmin = async (e) => {
        await axios.get('http://localhost:5000/admin/setAdmin/' + e.target.value);
        axios.get(url).then(json => setData(json.data));
        renderTable();
    };

    const renderTable = () => {
        return data.map(user => {
            return (
                <tr key ={user.username} style = {{height: '40px',}}>
                    <td style ={{borderLeft:'1px solid #eeeee4', borderBlockEnd: '1px solid'}}>{user.username}</td>

                    <td style ={{borderLeft:'1px solid #eeeee4', borderBlockEnd: '1px solid'}}>{user.email}</td>
                    <td style ={{ borderLeft:'1px solid #eeeee4', borderRight:'1px solid #eeeee4', borderBlockEnd: '1px solid'}}><img src={'https://jf-staeulalia.pt/img/other/30/collection-green-check-mark-6.jpg'} style={{ position: 'relative', left:'40%', height: '30px', width: '30px'}} value={user.username} onClick={setAdmin(key)} /></td>
                </tr>
            );
        });
